            builder
                .HasKey(s => s.Id);
            //builder
            //    .Property(s => s.Id)
            //    .IsRequired();
            builder
                .Property(s => s.Title)
                .HasMaxLength(50)
                .IsRequired();
            builder
                .Property(s => s.ShortDescription)
                .HasMaxLength(500)
                .IsRequired();
            builder
                .Property(s => s.Description)
                .HasMaxLength(4000)
                .IsRequired();
            builder
                .Property(s => s.Image)
                .HasMaxLength(4000);
            builder
                .Property(s => s.CreatedAt)
                .IsRequired();
            builder
                .Property(s => s.IsDeleted)
                .IsRequired();

            builder
                .HasOne(s => s.Category)
                .WithMany(c => c.Services)
                .HasForeignKey(s => s.CategoryId)
                .OnDelete(DeleteBehavior.Restrict);


